import React, { Component } from 'react';
import './cartBtn.scss';

class CartBtn extends Component {
    render() {
        return (
            <button className="cartBtn">
                <img name="cart" id="cartImg" src="/images/cart-image.png" alt="error"/>
                <p className="cartBtnTxt">My Cart</p>
            </button>
        )
    }
}

export default CartBtn
